import React, { useState } from "react";
import "./index.css";

function Login() {
  const [showPassword, setShowPassoword] = useState("text");

  return (
    <div className="telaLogin">
      <span style={{ marginRight: "180px" }}>E-mail</span> <br />
      <TextField type={"text"}></TextField> <br />
      <span style={{ marginRight: "180px" }}>Senha</span> <br />
      <TextField type={showPassword}>
        <IconButton aria-label="toggle password visibility"></IconButton>
      </TextField>
    </div>
  );
}

export default Login;
